<div className="kasa-group-card">
  {Logements.map((data, index) => (
    <Card key={index} titre_card={data.title} img_card={data.cover} /> // Boucle sur le nombre de logement présent dans le fichier logements.js
  ))}
</div>;
function Apropos() {
  return (
    <>
      <Banner_a_propos img_banner_a_propos="assets/photo_banner_a_propos.png" />
      <Tag type_tag="Cozy" titre_tag="Cozy" />
      <Tag type_tag="Canal" titre_tag="Canal" />
      <Tag type_tag="Paris 10" titre_tag="Paris 10" />
      <Collapse
        type_collapse="texte"
        description_collapse="description"
        titre_collapse="Fiabilité"
      />
      <Collapse
        type_collapse="liste"
        description_collapse="description"
        titre_collapse="Respect"
      />
      <Collapse
        type_collapse="texte"
        description_collapse="description"
        titre_collapse="Service"
      />
      <Collapse
        type_collapse="texte"
        description_collapse="description"
        titre_collapse="Sécurité"
      />
    </>
  );
}

export default Apropos;
